  input: '"TEXT","F3A","C00366195","In response to your August 26, 2003 letter requesting
    additional information in connection with this report we are filing an amended
    July Quarterly report in advance of the October Quarterly report disclosing the
    contributor information collected through our best efforts program.  We have amended
    this report to disclose the best efforts information received from individual
    contributors as well as information from political action committees.  In addition,
    we are providing an amended 3Z-1 form that discloses the gross receipts for the
    Primary and General Elections.  In compliance with the Commissions Regulations,
    we make a clear and conspicuous request for contributor information at the time
    of the solicitation and inform the contributor of the requirements under federal
    law for the collecting and reporting of such information.  If the information
    is not provided with the contribution we send a seperate written request within
    30 days of receipt of the contribution and a self addressed stamped envelope is
    provided to the contributor.  If the information is still not provided, we send
    a 2nd written notice.  We trust this response answers your questions.  Please
    do not hesitate to contact us with any further questions."'
